import React, { useState } from "react";
import MatrixDisplay from "./MatrixDisplay";

type MatrixTaskProps = {
  matrix: number[][];
  title?: string;
};

const MatrixTask: React.FC<MatrixTaskProps> = ({ matrix, title }) => {
  const [matrixState, setMatrixState] = useState(matrix);
  const [lambdaMax, setLambdaMax] = useState<number>(0);
  const [IS, setIS] = useState<number>(0);
  const [OS, setOS] = useState<number>(0);

  // Обновление значения в матрице
  const updateValue = (rowIndex: number, colIndex: number, newValue: number) => {
    const newMatrix = [...matrixState];
    newMatrix[rowIndex][colIndex] = newValue;
    setMatrixState(newMatrix);
  };

  // Генерация второй матрицы 4xN с дополнительными столбцами
  const matrix4 = [
    ['x', 'w', 'M * w', 'λ * w'], // Заголовки для второй таблицы
    ...matrixState.map((row, rowIndex) => [
      row[0], // x
      row[1], // w
      row[0] * row[1], // M * w
      (row[0] * row[1]).toFixed(2), // λ * w (отображаем с округлением)
    ]),
  ];

  return (
    <div style={styles.container}>
      {title && <h3 style={styles.title}>{title}</h3>}

      {/* Первая матрица: редактируемая */}
      <table style={styles.table}>
        <tbody>
          {matrixState.map((row, rowIndex) => (
            <tr key={rowIndex}>
              {row.map((cell, cellIndex) => (
                <td key={cellIndex} style={styles.cell}>
                  <input
                    type="number"
                    value={cell}
                    onChange={(e) => {
                      const value = parseFloat(e.target.value);
                      if (!isNaN(value)) {
                        updateValue(rowIndex, cellIndex, Math.round(value * 100) / 100); // Округляем до 2 знаков
                      }
                    }}
                    style={styles.inputCell}
                    step="0.01"
                  />
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>

      {/* Вторая матрица: вычисления */}
      <table style={styles.table}>
        <tbody>
          {matrix4.map((row, rowIndex) => (
            <tr key={rowIndex}>
              {row.map((cell, cellIndex) => (
                <td key={cellIndex} style={styles.cell}>
                  {cell}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>

      {/* Поля для ввода */}
      <div style={styles.inputContainer}>
        <label style={styles.inputLabel}>λmax:</label>
        <input
          type="number"
          value={lambdaMax}
          onChange={(e) => setLambdaMax(parseFloat(e.target.value).toFixed(2))}
          style={styles.input}
        />
        <label style={styles.inputLabel}>ИС:</label>
        <input
          type="number"
          value={IS}
          onChange={(e) => setIS(parseFloat(e.target.value).toFixed(2))}
          style={styles.input}
        />
        <label style={styles.inputLabel}>ОС:</label>
        <input
          type="number"
          value={OS}
          onChange={(e) => setOS(parseFloat(e.target.value).toFixed(2))}
          style={styles.input}
        />
      </div>
    </div>
  );
};

const styles: { [key: string]: React.CSSProperties } = {
  container: {
    background: "#f9f9f9",
    borderRadius: "8px",
    boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
    padding: "15px",
    textAlign: "center",
    margin: "10px 0",
  },
  title: {
    marginBottom: "10px",
    fontSize: "18px",
    fontWeight: "bold",
  },
  table: {
    width: "100%",
    borderCollapse: "collapse",
    marginBottom: "20px",
  },
  cell: {
    border: "1px solid #ccc",
    padding: "10px",
    textAlign: "center",
    minWidth: "50px",
    maxWidth: "50px",
    height: "50px",
  },
  inputCell: {
    width: "100%",
    border: "1px solid #ccc",
    borderRadius: "4px",
    textAlign: "center",
    fontSize: "14px",
    padding: "8px",
  },
  inputContainer: {
    display: "flex",
    flexDirection: "column",
    gap: "10px",
    marginTop: "20px",
  },
  inputLabel: {
    fontSize: "14px",
    fontWeight: "bold",
  },
  input: {
    padding: "8px",
    border: "1px solid #ccc",
    borderRadius: "4px",
    width: "100px",
    textAlign: "center",
  },
};

export default MatrixTask;
